// Breakpoint viewport sizes and media queries.
//
// Breakpoints are defined as a map of (name: minimum width), order from small to large:
//
//    (xs: 0, sm: 576px, md: 768px, lg: 992px, xl: 1200px)
//
// The map defined in the `$grid-breakpoints` global variable is used as the `$breakpoints` argument by default.

// Name of the next breakpoint, or null for the last breakpoint.
//
//    >> breakpoint-next(sm)
//    md
//    >> breakpoint-next(sm, (xs: 0, sm: 576px, md: 768px, lg: 992px, xl: 1200px))
//    md
//    >> breakpoint-next(sm, $breakpoint-names: (xs sm md lg xl))
//    md
@function breakpoint-next(
  $name,
  $breakpoints: $grid-breakpoints,
  $breakpoint-names: map-keys($breakpoints)
) {
  $n: index($breakpoint-names, $name);
  @return if(
    $n != null and $n < length($breakpoint-names),
    nth($breakpoint-names, $n + 1),
    null
  );
}

// Minimum breakpoint width. Null for the smallest (first) breakpoint.
//
//    >> breakpoint-min(sm, (xs: 0, sm: 576px, md: 768px, lg: 992px, xl: 1200px))
//    576px
@function breakpoint-min($name, $breakpoints: $grid-breakpoints) {
  $min: map-get($breakpoints, $name);
  @return if($min != 0, $min, null);
}

// Maximum breakpoint width. Null for the largest (last) breakpoint.
// The maximum value is calculated as the minimum of the next one less 0.02px
// to work around the limitations of `min-` and `max-` prefixes and viewports with fractional widths.
// See https://www.w3.org/TR/mediaqueries-4/#mq-min-max
// Uses 0.02px rather than 0.01px to work around a current rounding bug in Safari.
// See https://bugs.webkit.org/show_bug.cgi?id=178261
//
//    >> breakpoint-max(sm, (xs: 0, sm: 576px, md: 768px, lg: 992px, xl: 1200px))
//    767.98px
@function breakpoint-max($name, $breakpoints: $grid-breakpoints) {
  $next: breakpoint-next($name, $breakpoints);
  @return if($next, breakpoint-min($next, $breakpoints) - 0.02, null);
}

// Returns a blank string if smallest breakpoint, otherwise returns the name with a dash in front.
// Useful for making responsive utilities.
//
//    >> breakpoint-infix(xs, (xs: 0, sm: 576px, md: 768px, lg: 992px, xl: 1200px))
//    ""  (Returns a blank string)
//    >> breakpoint-infix(sm, (xs: 0, sm: 576px, md: 768px, lg: 992px, xl: 1200px))
//    "-sm"
@function breakpoint-infix($name, $breakpoints: $grid-breakpoints) {
  @return if(breakpoint-min($name, $breakpoints) == null, '', '-#{$name}');
}

// Media of at least the minimum breakpoint width. No query for the smallest breakpoint.
// Makes the @content apply to the given breakpoint and wider.
@mixin media-breakpoint-up($name, $breakpoints: $grid-breakpoints) {
  $min: breakpoint-min($name, $breakpoints);
  @if $min {
    @media (min-width: $min) {
      @content;
    }
  } @else {
    @content;
  }
}

// Media of at most the maximum breakpoint width. No query for the largest breakpoint.
// Makes the @content apply to the given breakpoint and narrower.
@mixin media-breakpoint-down($name, $breakpoints: $grid-breakpoints) {
  $max: breakpoint-max($name, $breakpoints);
  @if $max {
    @media (max-width: $max) {
      @content;
    }
  } @else {
    @content;
  }
}

// Media that spans multiple breakpoint widths.
// Makes the @content apply between the min and max breakpoints
@mixin media-breakpoint-between(
  $lower,
  $upper,
  $breakpoints: $grid-breakpoints
) {
  $min: breakpoint-min($lower, $breakpoints);
  $max: breakpoint-max($upper, $breakpoints);

  @if $min != null and $max != null {
    @media (min-width: $min) and (max-width: $max) {
      @content;
    }
  } @else if $max == null {
    @include media-breakpoint-up($lower, $breakpoints) {
      @content;
    }
  } @else if $min == null {
    @include media-breakpoint-down($upper, $breakpoints) {
      @content;
    }
  }
}

// Media between the breakpoint's minimum and maximum widths.
// No minimum for the smallest breakpoint, and no maximum for the largest one.
// Makes the @content apply only to the given breakpoint, not viewports any wider or narrower.
@mixin media-breakpoint-only($name, $breakpoints: $grid-breakpoints) {
  $min: breakpoint-min($name, $breakpoints);
  $max: breakpoint-max($name, $breakpoints);

  @if $min != null and $max != null {
    @media (min-width: $min) and (max-width: $max) {
      @content;
    }
  } @else if $max == null {
    @include media-breakpoint-up($name, $breakpoints) {
      @content;
    }
  } @else if $min == null {
    @include media-breakpoint-down($name, $breakpoints) {
      @content;
    }
  }
}

sources.scss\\components\\_hobbies.scss:
.hobby {
  font-size: 1.05rem;
  margin-top: 2rem;

  &__inner {
    padding: 0.5rem;
    background: $light-grey;
    display: flex;
    border: 2px solid transparent;
    border-radius: 0.25rem;
    align-items: center;
    position: relative;
    transition: all 0.5s ease;

    &::before {
      content: '';
      background: $divider-grey;
      width: 2px;
      height: 58px;
      position: absolute;
      left: 55px;
    }
  }
  &__icon {
    flex-basis: 20%;
    padding: 0.5rem;
    transition: all 0.5s ease;
    @include media-breakpoint-down(xs) {
      flex-basis: 40px;
    }
  }
  &__title {
    flex-basis: auto;
    text-align: left;
    padding-left: 1rem;
    @include media-breakpoint-down(md) {
      padding-left: 2rem;
    }

    h4 {
      font-weight: 500;
    }
  }
  &__inner:hover {
    transform: translateY(-5px);
    border-color: $divider-grey;
    background: #fff;
    box-shadow: -1px 3px 10px 0 rgba(0, 0, 0, 0.06);

    .hobby__icon {
      color: $primary;
    }
  }
}

sources.scss\\components\\_modal.scss:
.modal__overlay {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: rgba(11, 11, 11, 0.8);
  z-index: 1000;
  transition: all 0.5s ease;
  overflow: hidden;
  opacity: 0;
  visibility: hidden;
  pointer-events: none;

  &.active {
    opacity: 1;
    visibility: visible;
    pointer-events: all;
  }
}
.modal__container {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 1001;
  transition: all 0.5s ease;
  opacity: 0;
  visibility: hidden;
  pointer-events: none;

  &.active {
    opacity: 1;
    visibility: visible;
    pointer-events: all;
  }
}
.modal__wrapper {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  overflow: auto;
}
.modal {
  position: relative;
  padding: 2rem;
  width: auto;
  max-width: 767px;
  margin: 2rem auto;
  background: #fff;
  @include media-breakpoint-down(md) {
    max-width: 700px;
  }
  @include media-breakpoint-down(xs) {
    max-width: calc(100% - 1rem);
  }

  &__picture {
    max-width: 100%;
    width: 100%;
    height: 600px;
    background: #eee;
    margin-bottom: 1rem;
    @include media-breakpoint-down(xs) {
      height: 495px;
    }

    img {
      width: 100%;
      height: 100%;
      object-fit: cover;
    }
  }
  &__title {
    font-size: 1.7rem;
    font-weight: 700;
    color: $primary;
    margin-bottom: 1.8rem;
    padding-bottom: 0.9rem;
    border-bottom: 2px solid $divider-grey;
  }
  &__close {
    width: 2.8rem;
    height: 2.8rem;
    position: absolute;
    top: 0;
    right: 0;
    border: none;
    outline: none;
    background: rgba(119, 119, 119, 0.65);
    color: #fff;
    cursor: pointer;
    font-size: 1.9rem;

    &:hover {
      background: rgba(119, 119, 119, 1);
    }
  }
}
.project__detail {
  list-style: none;

  &-item {
    margin-bottom: 0.4rem;
  }
  &-label {
    font-weight: 700;
  }
}
.visit-project {
  background: $primary;
  color: #fff;
  text-decoration: none;
  line-height: 1;
  margin-top: 1rem;
  padding: 0.7rem;
  border-radius: 0.25rem;
  display: inline-block;
  transition: all 0.3s;

  &:hover {
    background: $default-font-color;
  }
}

sources.scss\\components\\_projects.scss:
.projects__container {
  display: flex;
  flex-wrap: wrap;
  padding: 0;
}
.project__item {
  max-width: 33.33%;
  width: 33.33%;
  flex: 0 0 33.33%;
  //height: 332px;
  padding: 0 1rem 1rem;
  @include media-breakpoint-down(md) {
    max-width: 50%;
    width: 50%;
    flex: 0 0 50%;
  }
  @include media-breakpoint-down(xs) {
    max-width: 100%;
    width: 100%;
    flex: 0 0 100%;
  }
}
.project__box {
  position: relative;
  overflow: hidden;
  box-shadow: 0px 0px 20px rgba(0, 0, 0, 0.07);
}
.project__link {
  opacity: 0;
  visibility: hidden;
  pointer-events: none;
}
.project__image {
  max-width: 100%;
  height: auto;
  vertical-align: middle;
  transition: all 2s ease;
}
.project__overlay {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  opacity: 0;
  transition: all 0.9s ease;
  transform: scale(0.7);
  background-color: rgba(27, 27, 27, 0.8);
  z-index: 1;
}
.project__icon {
  position: absolute;
  bottom: 50%;
  right: 0;
  left: 0;
  text-align: center;
  transition: all 0.5s ease;

  /* svg {
    color: #fff;
    font-size: 30px;
    margin: 0 auto;
    display: inline-block;
    &:hover {
      color: $primary;
      cursor: pointer;
    }
  } */
  a {
    position: absolute;
    top: 0;
    left: 50%;
    transform: translateX(-50%);
    width: 28px;
    height: 30px;
    cursor: pointer;
  }
  i {
    color: #fff;
    font-size: 30px;
    margin: 0 auto;
    display: inline-block;
  }
  &:hover i {
    color: $primary;
    cursor: pointer;
  }
}
.project__content {
  position: absolute;
  bottom: 5%;
  left: 5%;
}
.project__title {
  font-size: 0.94rem;
  color: $light-grey;
  letter-spacing: 0.03rem;
  text-transform: uppercase;

  &:hover {
    color: $primary;
  }
}
.project__category {
  font-size: 90%;
  font-weight: 400;
  color: rgba(255, 255, 255, 0.5);
}
.project__box:hover {
  .project__image {
    transform: scale(1.5) rotate(5deg);
  }
  .project__overlay {
    opacity: 1;
    transform: scale(1);
  }
}
.projects__extended {
  display: none;
}

sources.scss\\components\\_skills.scss:
.skill {
  margin-top: 2rem;

  &__wrapper {
    position: relative;
    height: 100%;
    border: 1px solid $divider-grey;
    border-radius: 5px;
    padding: 3rem 1.5rem;
    transition: all 0.5s ease;

    &::after {
      content: '';
      background-color: $primary;
      position: absolute;
      left: 50%;
      right: 50%;
      bottom: 0;
      display: block;
      height: 2px;
      width: 0;
      transition: 1s;
    }
  }
  &__icon {
    color: $primary;

    svg,
    i {
      font-size: 3rem;
    }
  }
  &__content {
    margin-top: 1rem;

    .title {
      font-size: 1.1rem;
      font-weight: 600;
      text-transform: uppercase;
      transition: all 0.5s ease;
    }
    .text {
      margin-top: 1rem;
      font-size: 0.94rem;
      color: $text-muted;
      line-height: 1.8;
      letter-spacing: 0.03rem;
    }
  }
  &__wrapper:hover {
    border: transparent;
    box-shadow: -1px 3px 10px 0 rgba(0, 0, 0, 0.06);
    transform: translateY(-5px);

    &::after {
      left: 0;
      right: 0;
      width: 100%;
    }
    .skill__icon {
      animation: mover 1s infinite alternate;
    }
    .title {
      color: $primary;
    }
  }
}

@keyframes mover {
  0% {
    transform: translateY(0);
  }
  100% {
    transform: translateY(-10px);
  }
}

